import React, { Component, Fragment } from 'react'

export default class Home extends Component {
  render() {
    return (
      <Fragment>
        <div className="home-bg">

          <div>
            <div>
              <a href="./Login.jsx">Login</a>
              <a href="./Signup.jsx">Sign Up</a>
            </div>

          </div>


        </div>

      </Fragment>
    )
  }
}
